import React from "react";

import {
    BrowserRouter as Router,
    Routes,
    Route,
} from "react-router-dom";
import page1 from "./pages/about"; // Adjust this import path accordingly
import page2 from "./pages/blogs"; // Adjust this import path accordingly

function App() {
    return (
        <Router>
            <Routes>
                <Route exact path="/" element={<page1 />} />
                <Route path="/about" element={<page2 />} />
            </Routes>
        </Router>
    );
}

export default App;
